-- ----------------------------
-- Post-processing: 统一一对一课程标题为“科目+一对一课程”
-- ----------------------------
BEGIN;
UPDATE `courses` c
JOIN `subjects` s ON c.`subject_id` = s.`id`
SET c.`title` = CONCAT(s.`name`, '一对一课程')
WHERE c.`course_type` = 'one_on_one';
COMMIT;


SET FOREIGN_KEY_CHECKS = 1;


-- Post-processing: 每位教师仅保留一门课程（保留该教师最小ID课程），其余删去；并将一对一课程时长置空
BEGIN;
-- 1) 一对一课程不需要设置固定时长：清空 duration_minutes
UPDATE `courses` SET `duration_minutes` = NULL WHERE `course_type` = 'one_on_one';
COMMIT;

BEGIN;
-- 2) 每位教师仅保留一门课程（保留最小ID），删除多余课程（幂等）
DELETE c FROM `courses` c
JOIN (
  SELECT teacher_id, MIN(id) AS keep_id
  FROM `courses`
  WHERE `is_deleted` = 0
  GROUP BY teacher_id
) k ON c.teacher_id = k.teacher_id
WHERE c.id <> k.keep_id;
COMMIT;
